    public String nombres(List<Integer> nombres){
        String retorno = "";
        for (int i = 0; i < nombres.size(); i++){
            String name = symbl_name_from_id(nombres.get(i));
            if (!name.equalsIgnoreCase("error")){
                if (i==nombres.size()-1){
                    retorno += name;
                } else {
                    retorno += name+", ";
                }
            }
        }
        return retorno;
    }

